import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { ShoppingCartIcon, TagIcon } from '@heroicons/react/24/outline';

const posters = [
  {
    id: 1,
    name: "Abstract Waves",
    description: "Modern abstract art poster with flowing waves",
    price: 399,
    image: "https://images.unsplash.com/photo-1518998053901-5348d3961a04?w=500&auto=format&fit=crop&q=60",
    tags: ["abstract", "modern", "waves"]
  },
  {
    id: 2,
    name: "Mountain Sunset",
    description: "Breathtaking mountain landscape at sunset",
    price: 449,
    image: "https://images.unsplash.com/photo-1501854140801-50d01698950b?w=500&auto=format&fit=crop&q=60",
    tags: ["nature", "landscape", "sunset"]
  },
  {
    id: 3,
    name: "Urban Architecture",
    description: "Modern city architecture in monochrome",
    price: 399,
    image: "https://images.unsplash.com/photo-1487958449943-2429e8be8625?w=500&auto=format&fit=crop&q=60",
    tags: ["urban", "architecture", "monochrome"]
  },
  {
    id: 4,
    name: "Geometric Patterns",
    description: "Bold geometric patterns in vibrant colors",
    price: 349,
    image: "https://images.unsplash.com/photo-1579547945413-497e1b99dac0?w=500&auto=format&fit=crop&q=60",
    tags: ["geometric", "patterns", "colorful"]
  },
  {
    id: 5,
    name: "Minimalist Design",
    description: "Clean and simple minimalist poster",
    price: 299,
    image: "https://images.unsplash.com/photo-1579783902614-a3fb3927b6a5?w=500&auto=format&fit=crop&q=60",
    tags: ["minimalist", "simple", "clean"]
  },
  {
    id: 6,
    name: "Vintage Collection",
    description: "Set of 3 vintage-inspired posters",
    price: 799,
    image: "https://images.unsplash.com/photo-1513151233558-d860c5398176?w=500&auto=format&fit=crop&q=60",
    tags: ["vintage", "collection", "retro"]
  }
];

const tags = ["all", "abstract", "nature", "urban", "geometric", "minimalist", "vintage"];

function Posters() {
  const [selectedTag, setSelectedTag] = useState("all");

  const filteredPosters = selectedTag === "all"
    ? posters
    : posters.filter(poster => poster.tags.includes(selectedTag));

  return (
    <div className="min-h-screen py-16 px-4">
      <div className="max-w-7xl mx-auto">
        {/* Header */}
        <div className="text-center mb-12">
          <motion.h1
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            className="text-4xl font-bold text-white mb-4"
          >
            Artistic Posters Collection
          </motion.h1>
          <motion.p
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 0.2 }}
            className="text-cyan-200"
          >
            Transform your space with our premium quality posters
          </motion.p>
        </div>

        {/* Tags Filter */}
        <div className="flex flex-wrap gap-2 justify-center mb-12">
          {tags.map((tag, index) => (
            <motion.button
              key={tag}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: index * 0.1 }}
              onClick={() => setSelectedTag(tag)}
              className={`px-4 py-2 rounded-full flex items-center gap-2 transition-colors ${
                selectedTag === tag
                  ? "bg-electric text-white"
                  : "bg-slate-800 text-cyan-200 hover:bg-slate-700"
              }`}
            >
              <TagIcon className="w-4 h-4" />
              {tag.charAt(0).toUpperCase() + tag.slice(1)}
            </motion.button>
          ))}
        </div>

        {/* Posters Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {filteredPosters.map((poster, index) => (
            <motion.div
              key={poster.id}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: index * 0.1 }}
              className="group bg-slate-900/80 border-2 border-electric/30 rounded-xl overflow-hidden hover:border-electric transition-colors"
            >
              <div className="aspect-w-16 aspect-h-12">
                <img
                  src={poster.image}
                  alt={poster.name}
                  className="object-cover w-full h-full transform group-hover:scale-105 transition-transform duration-300"
                />
              </div>
              <div className="p-6">
                <h3 className="text-lg font-semibold text-white mb-2">{poster.name}</h3>
                <p className="text-cyan-200 mb-4">{poster.description}</p>
                <div className="flex flex-wrap gap-2 mb-4">
                  {poster.tags.map(tag => (
                    <span
                      key={tag}
                      className="px-2 py-1 bg-slate-800 text-cyan-200 text-sm rounded-full"
                    >
                      {tag}
                    </span>
                  ))}
                </div>
                <div className="flex items-center justify-between">
                  <span className="text-xl font-bold text-electric">₹{poster.price}</span>
                  <button className="px-4 py-2 bg-electric text-white rounded-lg font-medium hover:bg-cyan-500 transition-colors flex items-center gap-2">
                    <ShoppingCartIcon className="w-5 h-5" />
                    Add to Cart
                  </button>
                </div>
              </div>
            </motion.div>
          ))}
        </div>

        {/* Empty State */}
        {filteredPosters.length === 0 && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            className="text-center py-12"
          >
            <p className="text-cyan-200 text-lg">No posters found for this category.</p>
          </motion.div>
        )}
      </div>
    </div>
  );
}

export default Posters;
